const formatDate = (formatStr, date) => {
	/*
	函数：填充0字符
	参数：value-需要填充的字符串, length-总长度
	返回：填充后的字符串
	*/
	const zeroize = function (value, length) {
			if (!length) {
					length = 2
			}
			value = new String(value)
			for (var i = 0, zeros = ''; i < (length - value.length); i++) {
					zeros += '0'
			}
					return zeros + value
	}
	return formatStr.replace(/"[^"]*"|'[^']*'|\b(?:d{1,4}|M{1,4}|yy(?:yy)?|([hHmstT])\1?|[lLZ])\b/g, function($0) {
			switch ($0) {
					case 'd': return date.getDate()
					case 'dd': return zeroize(date.getDate())
					case 'ddd': return ['Sun', 'Mon', 'Tue', 'Wed', 'Thr', 'Fri', 'Sat'][date.getDay()]
					case 'dddd': return ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'][date.getDay()]
					case 'M': return date.getMonth() + 1
					case 'MM': return zeroize(date.getMonth() + 1)
					case 'MMM': return ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'][date.getMonth()]
					case 'MMMM': return ['January', 'February', 'March', 'April', 'May', 'June', 'July', 'August', 'September', 'October', 'November', 'December'][date.getMonth()]
					case 'yy': return new String(date.getFullYear()).substr(2)
					case 'yyyy': return date.getFullYear()
					case 'h': return date.getHours() % 12 || 12
					case 'hh': return zeroize(date.getHours() % 12 || 12)
					case 'H': return date.getHours()
					case 'HH': return zeroize(date.getHours())
					case 'm': return date.getMinutes()
					case 'mm': return zeroize(date.getMinutes())
					case 's': return date.getSeconds()
					case 'ss': return zeroize(date.getSeconds())
					case 'l': return date.getMilliseconds()
					case 'll': return zeroize(date.getMilliseconds())
					case 'tt': return date.getHours() < 12 ? 'am' : 'pm'
					case 'TT': return date.getHours() < 12 ? 'AM' : 'PM'
			}
	})
}

const formatMoney = (number, symbol='',places=2 ) => {
  // number: 传入的数值，symbol: 货币符号， places: 保留小数位数
  number = number || 0
  let negative = number < 0 ? "-" : "",
      i = parseInt(number = Math.abs(+number || 0).toFixed(places), 10) + "",
      j = (j = i.length) > 3 ? j % 3 : 0
  return symbol + negative + (j ? i.substr(0, j) + ',' : "") + i.substr(j).replace(/(\d{3})(?=\d)/g, "$1" + ',') + (places ? '.' + Math.abs(number - i).toFixed(places).slice(2) : "")
}

const resetOrders = (orders, mount) => {
  let data = [...orders]
  let pages = [];

  while (data.length > 0) {
    let page = {mount:0, data: []};
    while (page.mount < mount) {
      const data0 = data[0];
      if (!data0) {
        break;
      }
      createPage(data0, page);
    }
    pages.push(page);
  }


  function createPage(data0, page) {
    const len = data0.items.length;
    const otherMount = mount - page.mount;
    if (len <= otherMount) {
      page.data.push(data0);
      page.mount += len;
      data.shift();
    } else {
      const arrA = data0.items.slice(0, otherMount);
      const arrB = data0.items.slice(otherMount);
      const itemA = {number: data0.number, items: arrA};
      const itemB = {number: data0.number, items: arrB};
      page.mount = mount;
      page.data.push(itemA);
      data.shift();
      data.unshift(itemB);
    }

  }

  return pages

}

